    [],nt"num_tags": 3,nt"name": "surveys-of-colonial-waterbirds-in-upper-cook-inlet-1983",nt"isopen":
    false,nt"url": null,nt"notes": "Nearly 11,000 mew gulls (Larus canus) and
    4,400 herring gulls or herring x glaucous-winged gull hybrids (L. argentatus x glaucescens)
    were found breeding in upper Cook Inlet. The mew gulls either concentrated in the
    wet meadows and marshes near the coast on the Susitna Flats and Palmer Hayflats
    or on scattered small ponds and wetlands in the Anchorage bowl. Herring gulls and
    hybrids tended to concentrate on islands in rivers or lakes associated with major
    river systems. A comparison of ground counts with aerial photos and visual estimates
    from planes determined that a correction factor of 1. 5 is conservative, but adequate
    for adjusting aerial estimates in upper Cook Inlet.  Some of the problems and possible
    solutions connected with aerial photography were discussed in light of the requirements
    of local habitat.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
